import {
  AlertDialog,
  AlertDialogAction,
  AlertDialogCancel,
  AlertDialogContent,
  AlertDialogDescription,
  AlertDialogFooter,
  AlertDialogHeader,
  AlertDialogTitle,
  AlertDialogTrigger,
} from "@/components/ui/alert-dialog";
import { Button } from "@/components/ui/button";
import { Input } from "./ui/input";
import { addTransaction } from "@/firebase/functions";
import { useEffect, useState } from "react";
import Loader from "./loader";
import { toast } from "sonner";
import { Loader2 } from "lucide-react";
import { Contract } from "ethers";
import { ERC20ABI } from "@/contract";
import { getInstance } from "@/utils/fhEVM";
import { useSelector } from "react-redux";
import Image from "next/image";
import { Label } from "./ui/label";

export function SendButton({ w0, setData, balanceOfEncryptedErc20, balance }) {
  const {
    erc20ContractAddress: { erc20ContractAddress },
  } = useSelector((state) => state);
  const [open, setOpen] = useState(false);
  const [receiverAddress, setReceiverAddress] = useState("");
  const [value, setValue] = useState("0");
  const [loading, setLoading] = useState(false);
  const [encryptedValue, setEncryptedValue] = useState("");
  const [fhEVM, setFhEVM] = useState(null);

  const getFHEVMInstance = async () => {
    const fhevmInstance = await getInstance();
    return fhevmInstance;
  };

  useEffect(() => {
    getFHEVMInstance().then((instance) => {
      setFhEVM(instance);
      console.log("instanceCreated");
    });
  }, []);

  useEffect(() => {
    if (fhEVM) {
      console.log(fhEVM.encrypt32(Number(value)));
      setEncryptedValue(fhEVM.encrypt32(Number(value)));
    }
  }, [value, fhEVM]);

  const mint = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const provider = await w0?.getEthersProvider();
      const signer = await provider?.getSigner();
      const encryptedERC20 = new Contract(
        erc20ContractAddress,
        ERC20ABI,
        signer
      );
      const fhevmInstance = await getInstance();

      const txn = await encryptedERC20.transfer(
        receiverAddress,
        fhevmInstance.encrypt32(Number(value))
      );
      await txn.wait(1);
      console.log(txn);
      console.log(txn.value.toString());

      console.log("Minting 1e5 usdc to bob successful!");
      toast.success("Minting successful");
      await balanceOfEncryptedErc20();
      const transaction = {
        type: "sent",
        value: 0,
        status: "success",
        transactionHash: txn.hash,
        activity: `sending money to ${receiverAddress}`,
        addresses: w0.address,
        receiverAddress: receiverAddress,
        date: new Date().toISOString(),
      };
      await addTransaction(transaction);
      setData((prevData) => [transaction, ...prevData]);
      setLoading(false);
      setOpen(false);
      toast.success("Transaction added successfully");
    } catch (error) {
      console.error("Error adding transaction", error);
      setLoading(false);
      toast.error("Error adding transaction");
    }
  };

  return (
    <AlertDialog open={open} onOpenChange={(e) => setOpen(e)}>
      <AlertDialogTrigger asChild>
        <Button className="w-full">Encrypted Send</Button>
      </AlertDialogTrigger>
      <AlertDialogContent className="p-0 min-w-fit">
        <div className="flex">
          <div className="p-8 h-full bg-[#BCD0FC] grid place-content-between">
            <Image src={"/icons/sendpo.svg"} width={153} height={153} />
            <div className="w-full grid place-content-center">
              <div className="w-24 text-sm text-center">
                Encryption by <span className="font-bold">Inco FHE</span>
              </div>
            </div>
          </div>
          <div className="p-8 pb-6">
            <AlertDialogHeader>
              <AlertDialogTitle>Encrypted Send</AlertDialogTitle>
              <AlertDialogDescription className="w-80">
                Your transaction will be visible but the amount will be
                encrypted.
              </AlertDialogDescription>
            </AlertDialogHeader>
            <div className="grid gap-7 mt-7">
              <div>
                <Label className="font-bold">To</Label>
                <Input
                  placeholder="Recipient's Address"
                  className="mt-3"
                  value={receiverAddress}
                  onChange={(e) => setReceiverAddress(e.target.value)}
                />
              </div>

              <div>
                <div className="w-full flex items-center justify-between">
                  <Label className="font-bold">Amount</Label>
                  <p className="text-sm text-muted-foreground">
                    Available: {balance} USDC
                  </p>
                </div>

                <div className="relative w-full pb-14">
                  <Input
                    placeholder="Tokens to be sent"
                    className="mt-3"
                    value={value}
                    onChange={(e) => setValue(e.target.value)}
                  />
                  <div
                    className="absolute right-2 text-[#1958DF] cursor-pointer top-2"
                    onClick={() => setValue(balance)}
                  >
                    Max
                  </div>
                </div>

                <div className="div">
                  {" "}
                  <AlertDialogFooter>
                    <AlertDialogCancel className="bg-[#EEEEEE]">
                      Cancel
                    </AlertDialogCancel>
                    <AlertDialogAction
                      disabled={loading}
                      onClick={(e) => mint(e)}
                    >
                      {loading ? (
                        <div className="w-12 grid items-center justify-center">
                          <Loader2 className="animate-spin" />
                        </div>
                      ) : (
                        "Confirm"
                      )}
                    </AlertDialogAction>
                  </AlertDialogFooter>
                </div>
              </div>
            </div>

            {/* <p className="max-w-44">
              {encryptedValue && encryptedValue.slice(0, 10) + "..."}
            </p> */}
          </div>
        </div>
      </AlertDialogContent>
    </AlertDialog>
  );
}

